    }

    drawChart = () => {
        const data = [12,5,6,6,9,10];
        const svg = d3.select("#root")
                    .append("svg")
                    .attr("width", 700)
                    .attr("height", 300);
    }
    render() { 
        return (
        <React.Fragment>
            {this.drawChart()}
        </React.Fragment>
        );
    }
}

export default BarChart;
